import React, { useState, useEffect } from "react";
import { Calendar } from "antd";

function HomePage() {
  return (
    <div>
      <h1>Bem vindo, Fernandinho!</h1>
      <div className="calendar">
        <Calendar />
      </div>
    </div>
  );
}

export default HomePage;
